void model_init(){
    conv2d_4_data = init_conv2d_4_data();
    conv2d_5_data = init_conv2d_5_data();
    batch_normalization_4_data = init_batch_normalization_4_data();
    conv2d_6_data = init_conv2d_6_data();
    batch_normalization_5_data = init_batch_normalization_5_data();
    conv2d_7_data = init_conv2d_7_data();
    batch_normalization_6_data = init_batch_normalization_6_data();
    dense_2_data = init_dense_2_data();
    batch_normalization_7_data = init_batch_normalization_7_data();
    dense_3_data = init_dense_3_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    data3d_t output0;

    //*************** LAYER 0 ***************//
    // Layer name: conv2d_4
    conv2d_layer(conv2d_4_data, input, &output0);
    // Activation layer for conv2d_4
    relu_activation(output0.data, 14400);
    // Debug function for layer conv2d_4
    print_data3d_t("conv2d_4", output0);

    input = output0;

    //*************** LAYER 1 ***************//
    // Layer name: conv2d_5
    conv2d_layer(conv2d_5_data, input, &output0);
    // Activation layer for conv2d_5
    relu_activation(output0.data, 12544);
    // Debug function for layer conv2d_5
    print_data3d_t("conv2d_5", output0);

    //*************** LAYER 2 ***************//
    // Layer name: batch_normalization_4
    batch_normalization3d_layer(batch_normalization_4_data, &output0);
    // Debug function for layer batch_normalization_4
    print_data3d_t("batch_normalization_4", output0);

    input = output0;

    //*************** LAYER 3 ***************//
    // Layer name: max_pooling2d_3

    static const pooling2d_layer_t max_pooling2d_3_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_3_data, input, &output0);
    // Debug function for layer max_pooling2d_3
    print_data3d_t("max_pooling2d_3", output0);

    input = output0;

    //*************** LAYER 4 ***************//
    // Layer name: conv2d_6
    conv2d_layer(conv2d_6_data, input, &output0);
    // Activation layer for conv2d_6
    relu_activation(output0.data, 4608);
    // Debug function for layer conv2d_6
    print_data3d_t("conv2d_6", output0);

    //*************** LAYER 5 ***************//
    // Layer name: batch_normalization_5
    batch_normalization3d_layer(batch_normalization_5_data, &output0);
    // Debug function for layer batch_normalization_5
    print_data3d_t("batch_normalization_5", output0);

    input = output0;

    //*************** LAYER 6 ***************//
    // Layer name: max_pooling2d_4

    static const pooling2d_layer_t max_pooling2d_4_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_4_data, input, &output0);
    // Debug function for layer max_pooling2d_4
    print_data3d_t("max_pooling2d_4", output0);

    input = output0;

    //*************** LAYER 7 ***************//
    // Layer name: conv2d_7
    conv2d_layer(conv2d_7_data, input, &output0);
    // Activation layer for conv2d_7
    relu_activation(output0.data, 1024);
    // Debug function for layer conv2d_7
    print_data3d_t("conv2d_7", output0);

    //*************** LAYER 8 ***************//
    // Layer name: batch_normalization_6
    batch_normalization3d_layer(batch_normalization_6_data, &output0);
    // Debug function for layer batch_normalization_6
    print_data3d_t("batch_normalization_6", output0);

    input = output0;

    //*************** LAYER 9 ***************//
    // Layer name: max_pooling2d_5

    static const pooling2d_layer_t max_pooling2d_5_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_5_data, input, &output0);
    // Debug function for layer max_pooling2d_5
    print_data3d_t("max_pooling2d_5", output0);

    input = output0;
    data1d_t output1;

    //*************** LAYER 10 ***************//
    // Layer name: flatten_1
    flatten3d_layer(input, &output1);
    // Debug function for layer flatten_1
    print_data1d_t("flatten_1", output1);
    data1d_t input1;

    input1 = output1;

    //*************** LAYER 11 ***************//
    // Layer name: dense_2
    dense_layer(dense_2_data, input1, &output1);
    // Activation layer for dense_2
    relu_activation(output1.data, 100);
    // Debug function for layer dense_2
    print_data1d_t("dense_2", output1);

    //*************** LAYER 12 ***************//
    // Layer name: batch_normalization_7
    batch_normalization1d_layer(batch_normalization_7_data, &output1);
    // Debug function for layer batch_normalization_7
    print_data1d_t("batch_normalization_7", output1);

    input1 = output1;

    //*************** LAYER 13 ***************//
    // Layer name: dense_3
    dense_layer(dense_3_data, input1, &output1);
    // Activation layer for dense_3
    softmax_activation(output1.data, 10);
    // Debug function for layer dense_3
    print_data1d_t("dense_3", output1);


    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
        return argmax(*results); 
    //return argmax(data1d_t);

}

